static int32_t AcdbDataGetAFESideToneLookupKey (AcdbDataAfeLookupKeyType *pCmd,
                                                AcdbDataLookupKeyType *pRsp)
{
   int32_t result = ACDB_SUCCESS;
   if (pCmd == NULL || pRsp == NULL)
   {
      result = ACDB_BADPARM;
   }
   else
   {
      int32_t i = 0;
      result = ACDB_PARMNOTFOUND;
      for (; i < SIZE_OF_ARRAY (AcdbDataAFELookup); ++i)
      {
         if (0 == memcmp (pCmd, &AcdbDataAFELookup[i], sizeof (AcdbDataAfeLookupKeyType)))
         {
            pRsp->nLookupKey = AcdbDataAFETable[i].ulTableKey;
            result = ACDB_SUCCESS;
            break;
         }
      }
   }
   return result;
}

static int32_t AcdbDataGetAFESideToneTable (AcdbDataLookupKeyType *pKey,
                                            AcdbDataGetTblTopType *pTblTop)
{
   int32_t result = ACDB_SUCCESS;
   if (pKey == NULL || pTblTop == NULL)
   {
      result = ACDB_BADPARM;
   }
   else
   {
      uint32_t i = 0;
      result = ACDB_PARMNOTFOUND;
      for (; i < SIZE_OF_ARRAY (AcdbDataAFETable); ++i)
      {
         if (pKey->nLookupKey == AcdbDataAFETable[i].ulTableKey)
         {
            pTblTop->ppTable = (AcdbDataUniqueDataNodeType **) AcdbDataAFETable[i].ppTable;
            pTblTop->nTableEntries = AcdbDataAFETable[i].ulTableSize;
            pTblTop->pTopology = (AcdbDataTopologyType *) AcdbDataAFETable[i].pTopology;
            pTblTop->nTopologyEntries = AcdbDataAFETable[i].ulTopologySize;
            result = ACDB_SUCCESS;
            break;
         }
      }
   }
   return result;
}

